import React, { useState, useEffect } from 'react';
import {
  Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow,
  FormControl, InputLabel, Select, MenuItem, Box
} from '@mui/material';
import { getAllReports } from '../services/api';

const statusOptions = ['Submitted', 'Reviewed', 'Rejected'];
const nameOptions = ['Alice', 'Bob', 'Charlie'];
const dateOptions = ['2024-06-01', '2024-06-02', '2024-06-03'];

export default function ReportsTable() {
  const [filters, setFilters] = useState({ name: '', date: '', status: '' });
  const [reports, setReports] = useState([]);

  useEffect(() => {
    getAllReports(filters).then(setReports);
  }, [filters]);

  const handleChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  return (
    <Paper>
      <Box sx={{ display: 'flex', gap: 2, p: 2 }}>
        <FormControl sx={{ minWidth: 120 }}>
          <InputLabel>Name</InputLabel>
          <Select
            name="name"
            value={filters.name}
            label="Name"
            onChange={handleChange}
          >
            <MenuItem value="">All</MenuItem>
            {nameOptions.map((n) => (
              <MenuItem key={n} value={n}>{n}</MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl sx={{ minWidth: 120 }}>
          <InputLabel>Date</InputLabel>
          <Select
            name="date"
            value={filters.date}
            label="Date"
            onChange={handleChange}
          >
            <MenuItem value="">All</MenuItem>
            {dateOptions.map((d) => (
              <MenuItem key={d} value={d}>{d}</MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl sx={{ minWidth: 120 }}>
          <InputLabel>Status</InputLabel>
          <Select
            name="status"
            value={filters.status}
            label="Status"
            onChange={handleChange}
          >
            <MenuItem value="">All</MenuItem>
            {statusOptions.map((s) => (
              <MenuItem key={s} value={s}>{s}</MenuItem>
            ))}
          </Select>
        </FormControl>
      </Box>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Employee</TableCell>
              <TableCell>Date</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>View</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {reports.map((r) => (
              <TableRow key={r.id}>
                <TableCell>{r.employee}</TableCell>
                <TableCell>{r.date}</TableCell>
                <TableCell>{r.status}</TableCell>
                <TableCell>
                  <a href="#">View</a>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
}
